import { useState, useEffect } from 'react';
import { Link } from 'react-scroll';
import axios from 'axios';
import './App.css';

function App() {
  const [skills, setSkills] = useState([]);
  const [projects, setProjects] = useState([]);
  const [certificates, setCertificates] = useState([]);
  const [contactForm, setContactForm] = useState({ name: '', email: '', message: '' });
  const [formStatus, setFormStatus] = useState('');

  useEffect(() => {
    axios.get('http://localhost:5000/api/skills').then(res => setSkills(res.data));
    axios.get('http://localhost:5000/api/projects').then(res => setProjects(res.data));
    axios.get('http://localhost:5000/api/certificates').then(res => setCertificates(res.data));
  }, []);

  const handleContactSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.post('http://localhost:5000/api/contact', contactForm);
      setFormStatus('Message sent successfully!');
      setContactForm({ name: '', email: '', message: '' });
    } catch (error) {
      setFormStatus('Failed to send message.');
    }
  };

  return (
    <div className="min-h-screen bg-gray-100">
      {/* Navbar */}
      <nav className="bg-blue-600 text-white p-4 fixed w-full top-0 z-10">
        <div className="container mx-auto flex justify-between items-center">
          <div className="text-2xl font-bold">Panga Syamsundar Rao</div>
          <div className="space-x-4">
            {['Home', 'Skills', 'Projects', 'Certificates', 'Experience', 'About', 'Contact'].map(item => (
              <Link key={item} to={item.toLowerCase()} smooth={true} duration={500} className="cursor-pointer hover:text-blue-200">
                {item}
              </Link>
            ))}
          </div>
        </div>
      </nav>

      {/* Home */}
      <section id="home" className="h-screen flex items-center justify-center bg-gray-200">
        <div className="text-center">
          <h1 className="text-4xl font-bold">Welcome to My Portfolio</h1>
          <p className="mt-4 text-lg">Hi, I'm Panga Syamsundar Rao, a Full Stack Developer</p>
        </div>
      </section>

      {/* Skills */}
      <section id="skills" className="py-16 bg-white">
        <div className="container mx-auto">
          <h2 className="text-3xl font-bold text-center mb-8">Skills</h2>
          <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
            {skills.map(skill => (
              <div key={skill.id} className="p-4 bg-gray-100 rounded shadow">{skill.name}</div>
            ))}
          </div>
        </div>
      </section>

      {/* Projects */}
      <section id="projects" className="py-16 bg-gray-100">
        <div className="container mx-auto">
          <h2 className="text-3xl font-bold text-center mb-8">Projects</h2>
          <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
            {projects.map(project => (
              <div key={project.id} className="p-4 bg-white rounded shadow">
                <h3 className="text-xl font-bold">{project.title}</h3>
                <p>{project.description}</p>
                <a href={project.link} target="_blank" rel="noopener noreferrer" className="text-blue-600 hover:underline">View Project</a>
              </div>
            ))}
          </div>
        </div>
      </section>

      {/* Certificates */}
      <section id="certificates" className="py-16 bg-white">
        <div className="container mx-auto">
          <h2 className="text-3xl font-bold text-center mb-8">Certificates</h2>
          <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
            {certificates.map(cert => (
              <div key={cert.id} className="p-4 bg-gray-100 rounded shadow">
                <h3 className="text-xl font-bold">{cert.name}</h3>
                <p>{cert.issuer} - {cert.year}</p>
              </div>
            ))}
          </div>
        </div>
      </section>

      {/* Experience */}
      <section id="experience" className="py-16 bg-gray-100">
        <div className="container mx-auto">
          <h2 className="text-3xl font-bold text-center mb-8">Experience</h2>
          <div className="p-4 bg-white rounded shadow">
            <h3 className="text-xl font-bold">Full Stack Java Developer Course</h3>
            <p>Naresh I Technologies, Hyderabad - Ongoing</p>
            <p>Currently pursuing a comprehensive course in full-stack development with Java, React, and MySQL.</p>
          </div>
        </div>
      </section>

      {/* About */}
      <section id="about" className="py-16 bg-white">
        <div className="container mx-auto">
          <h2 className="text-3xl font-bold text-center mb-8">About Me</h2>
          <p className="text-lg text-center">
            I am a B.Tech graduate in Computer Science & Engineering from CT University, Punjab (2020, CGPA: 7.2). I am passionate about software development, with expertise in Java, React, Spring Boot, and MySQL. I am a well-organized, energetic, and goal-oriented individual with strong problem-solving and leadership skills.
          </p>
        </div>
      </section>

      {/* Contact */}
      <section id="contact" className="py-16 bg-gray-100">
        <div className="container mx-auto">
          <h2 className="text-3xl font-bold text-center mb-8">Contact Me</h2>
          <form onSubmit={handleContactSubmit} className="max-w-lg mx-auto">
            <div className="mb-4">
              <label className="block text-lg mb-2">Name</label>
              <input
                type="text"
                value={contactForm.name}
                onChange={e => setContactForm({ ...contactForm, name: e.target.value })}
                className="w-full p-2 border rounded"
                required
              />
            </div>
            <div className="mb-4">
              <label className="block text-lg mb-2">Email</label>
              <input
                type="email"
                value={contactForm.email}
                onChange={e => setContactForm({ ...contactForm, email: e.target.value })}
                className="w-full p-2 border rounded"
                required
              />
            </div>
            <div className="mb-4">
              <label className="block text-lg mb-2">Message</label>
              <textarea
                value={contactForm.message}
                onChange={e => setContactForm({ ...contactForm, message: e.target.value })}
                className="w-full p-2 border rounded"
                rows="5"
                required
              ></textarea>
            </div>
            <button type="submit" className="bg-blue-600 text-white p-2 rounded hover:bg-blue-700">Send Message</button>
            {formStatus && <p className="mt-4 text-center">{formStatus}</p>}
          </form>
        </div>
      </section>

      {/* Footer */}
